                                <Label htmlFor="clientNumber">{data.dataMatrizCompetitiva.observations == "" || data.dataMatrizCompetitiva.observations == null ? t("NoData") : (data.dataMatrizCompetitiva.observations ? t("yes") : t("not"))}</Label>
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
                {/* Previsualizacion de Recomendaciones pantalla 25 */}
                <Card>
                    <CardHeader>
                        <h5>{t("RecomendationsAndOthers")}</h5>
                    </CardHeader>
                    <CardBody>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Recomendations")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.recommendations == "" || data.dataNegociosObtener.recommendations == null ? t("NoData") : data.dataNegociosObtener.recommendations}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("ValueChain")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.valueChain == "" || data.dataNegociosObtener.valueChain == null ? t("NoData") : data.dataNegociosObtener.valueChain}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("Background")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.background == "" || data.dataNegociosObtener.background == null ? t("NoData") : data.dataNegociosObtener.background}</Label>
                            </Col>
                        </Row>
                        <Row>
                            <Col xl="2">
                                <strong htmlFor="clientNumber">{t("RefinancingLog")}</strong>
                            </Col>
                            <Col xl="10">
                                <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.refinancingLog == "" || data.dataNegociosObtener.refinancingLog == null ? t("NoData") : data.dataNegociosObtener.refinancingLog}</Label>
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
            </div>
        </Modal>
    );
};

